import React from 'react'
import { useNavigate } from 'react-router-dom'
const Navbar = ({isLoggedIn}) => {
    const navigate = useNavigate()
    const handleNavigate = (page) => {
        navigate(page)
    }
    const handleLogOut = async()=>{
        const result = await fetch("http://localhost:3004/logout",{
            method:"POST",
            credentials:"include"
        });
        if(result.ok){
            handleNavigate("/login")
        }
    }
    return (
        <div className='flex py-16 px-20 justify-between'>
            <h2 className='font-bold text-2xl'>MyBlog</h2>
            <ul className='flex w-1/12 text-xl justify-between'>
            {isLoggedIn? <>
            <li onClick={() => handleNavigate("/login")}>Login</li>
                <li onClick={() => handleNavigate("/signup")}>Register</li>
            </>:
                <>
                <li onClick={() => handleNavigate("/newpost")}>Create New Post</li>
                <li onClick={handleLogOut}>Logout</li></>}

            </ul>
        </div>
    )
}

export default Navbar
